import React, { useState, useEffect } from "react";
import Axios from "axios";
import Select from "react-select";
import { Header } from "./PagesElements";
import "./PagesElements.css";
  
const Search = () => {
  const getPrescriptionSearchData = () => {
    Axios.post("http://localhost:8080/api/test3", {}).then((res) => {
      console.log(res.data);
    });
  };
  return (
    <div className="Search">
    <Header>Wyszukiwarka recept</Header>
    <div className="inputsWrapper">
      <div>
        <label>ID Recepty:</label>
        <input
          type="text"
          name="id_recepty"
          onChange={(e) => {
            setIdRecepty(e.target.value);
          }}
        />
      </div>
      <div>
        <label>Klucz Recepty:</label>
        <input
          type="text"
          name="klucz_recepty"
          onChange={(e) => {
            setKluczRecepty(e.target.value);
          }}
        />
      </div>
      <div>
        <label>ID Pakietu Recept:</label>
        <input
          type="text"
          name="id_pakietu_recept"
          onChange={(e) => {
            setIdPakietuRecept(e.target.value);
          }}
        />
      </div>
      <div>
        <label>ID UÅ¼ytkownika:</label>
        <input
          type="text"
          name="id_uÅ¼ytkownika"
          onChange={(e) => {
            setIdUÅ¼ytkownika(e.target.value);
          }}
        />
      </div>
    </div>

    <button onClick={submitStatus}>submitStatus</button>
    <button onClick={javaTest}>javaTest</button>
    <button onClick={getMedicines}>getMedicines</button>
    <button onClick={getPackages}>getPackages</button>

    <select
      value
      onChange={(e) => {
        submitMedicine(e.target.value);
      }}
    >
      {MedicineList}
    </select>

    <select
      value={null}
      onChange={(e) => {
        submitPackage(e.target.value);
      }}
    >
      {PrescriptionList}
    </select>
    {/* <table className="styled-table"> */}
    {/* <div className="scrollit"> */}
    {/* <thead>
                    <tr>
                        <th>EAN</th>
                        <th>jednostka_dawki</th>
                        <th>dawka</th>
                        <th>substancja_czynna</th>
                        <th>nazwa</th>
                        <th>postac</th>
                        <th>zawartosc_opakowania</th>
                        <th>rodzaj_leku</th>
                        <th>urzedowa_cena_zbytu</th>
                        <th>cena_hurtowa_brutto</th>
                        <th>cena_detaliczna</th>
                        <th>wysokosc_limitu_finansowania</th>
                        <th>doplata_swiadczeniobiorcy</th>
                        <th>poziom_odplatnosci</th>
                        <th>lista_refundacyjna</th>
                        <th>wskazania</th>
                    </tr>
                </thead> */}
    {/* <tbody> */}
    {console.log(medicineInformations)}
    {medicineInformations &&
      medicineInformations.map((information) => (
        <div className="medicineTable">
          <div>
            <p>{information.EAN}</p> <p>EAN</p>
          </div>
          <div>
            <p>{information.EAN}</p> <p>EAN</p>
          </div>
          <div>
            <p>{information.EAN}</p> <p>EAN</p>
          </div>
          <div>
            <p>{information.EAN}</p> <p>EAN</p>
          </div>
          <div>
            <p>{information.EAN}</p> <p>EAN</p>
          </div>
          <div>
            <p>{information.EAN}</p> <p>EAN</p>
          </div>
          <div>
            <p>{information.EAN}</p> <p>EAN</p>
          </div>
          <div>
            <p>{information.EAN}</p> <p>EAN</p>
          </div>
          <div>
            <p>{information.EAN}</p> <p>EAN</p>
          </div>
          <div>
            <p>{information.EAN}</p> <p>EAN</p>
          </div>
          <div>
            <p>{information.EAN}</p> <p>EAN</p>
          </div>
          {/* <td>{information.EAN} <p>EAN</p></td>
                            <td>{information.jednostka_dawki}<p>EANasdasd</p></td>
                            <td>{information.dawka}<p>EANasdas asdaddassdsd</p></td> */}
          {/* <td>{information.substancja_czynna}</td>
                            <td>{information.nazwa}</td>
                            <td>{information.postac}</td>
                            <td>{information.zawartosc_opakowania}</td>
                            <td>{information.rodzaj_leku}</td>
                            <td>{information.urzedowa_cena_zbytu}</td>
                            <td>{information.cena_hurtowa_brutto}</td>
                            <td>{information.cena_detaliczna}</td>
                            <td>{information.wysokosc_limitu_finansowania}</td>
                            <td>{information.doplata_swiadczeniobiorcy}</td>
                            <td>{information.poziom_odplatnosci}</td>
                            <td>{information.lista_refundacyjna}</td>
                            <td>{information.wskazania}</td> */}
        </div>
      ))}
    {/* </tbody> */}
    {/* </div> */}
    {/* </table> */}
    <table className="styled-table">
      <div className="scrollit">
        <thead>
          <tr>
            <th>TwÃ³j pakiet recept</th>
          </tr>
        </thead>
        <tbody>
          {prescriptionPackage &&
            prescriptionPackage.map((prescription) => (
              <tr key={prescription.nazwa}>
                <td>{prescription.nazwa}</td>
              </tr>
            ))}
        </tbody>
      </div>
    </table>
  </div>
  );
};
  
export default Search;
